public class Pipeline {



	public static void main(String[] args) {



		Scanner sc = new Scanner(System.in);

		Long n = sc.nextLong(), k = sc.nextLong();

		sc.close();



		k--;

		n--;



		Long limit = (k * (k + 1)) / 2 ;



		if (n > limit) {

			System.out.println(-1);



		} else if ( n == 0 ) {

			System.out.println(0);



		} else if (n <= k) {

			System.out.println(1);



		} else {



			Long count = 0L;

			Long end = k;



			Long sk = BS(end,n); //findMaxRange(n,end);



			count += end - sk + 1 ;



			Long cur = ( end * (end+1) / 2 ) -  ( sk * (sk-1) / 2 ) ;



			n = n - cur ;



			if ( n != 0 ) {

				count++;

			}



			System.out.println(count);

		}



		// erke



	}



	public static Boolean valid(Long mid,Long e,Long n){



		Long cur = ( e * (e+1) / 2 ) -  ( mid * (mid-1) / 2 ) ;



		if (cur <= n )

			return true;

		return false;

	}



	public static Long BS(Long x, Long n){

		Long s=1L,e=x,m=0L;

		while(s<e){

			m=(s+e+1)/2-1;

			if(!valid(m,x,n))

				s=m+1;

			else 

				e=m;

		}

		return s;

	}





}
