			num--;

			out = (char) (num % 26 + 'A') + out;

			num /= 26;

		}

		return out;

	}



	public static int charToNumCoord(String str) {

		int num = 0;

		for (int i = 0; i < str.length(); i++) {

			num = num * 26 + (str.charAt(i) - 'A' + 1);

		}

		return num;

	}

