class DSU
{
    int parent[], rank[];
    DSU(int n)
    {
        parent=new int[n];
        rank=new int[n];
        for (int i = 0; i <n ; i++) {
            parent[i]=-1;
            rank[i]=1;
        }
    }

   int find(int s1)
    {
        if(parent[s1]==-1)
            return s1;

        parent[s1]=find(parent[s1]);
        return parent[s1];
    }

    void unite(int s1,int s2)
    {
        int p1 =find(s1);
        int p2 =find(s2);

        if(p1!=p2)
        {
           if(rank[p1]>rank[p2])
           {
               parent[p2] = find(p1);
               rank[p1]+=rank[p2];
           }
           else
           {
               parent[p1] =find(p2);
               rank[p2]+=rank[p1];
           }
        }
    }
}

