public class Main {


    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        int m = scanner.nextInt();
        int k = scanner.nextInt();
        if (k % 2 == 1) {
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < m; j++) {
                    System.out.print("-1 ");
                }
                System.out.println();
            }
            return;
        }
        k /= 2;
        int[][][] dp = new int[n][m][2];
        int[][] h = new int[n][m];
        int[][] v = new int[n][m];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m - 1; j++) {
                h[i][j] = scanner.nextInt();
            }
        }
        for (int i = 0; i < n - 1; i++) {
            for (int j = 0; j < m; j++) {
                v[i][j] = scanner.nextInt();
            }
        }
        for (int i = 0; i < k; i++) {
            for (int a = 0; a < n; a++) {
                for (int b = 0; b < m; b++) {
                    int t = Integer.MAX_VALUE;
                    if (a != n - 1) t = Math.min(t, dp[a + 1][b][1 - i % 2] + v[a][b] * 2);
                    if (a != 0) t = Math.min(t, dp[a - 1][b][1 - i % 2] + v[a - 1][b] * 2);
                    if (b != m - 1) t = Math.min(t, dp[a][b + 1][1 - i % 2] + h[a][b] * 2);
                    if (b != 0) t = Math.min(t, dp[a][b - 1][1 - i % 2] + h[a][b - 1] * 2);
                    dp[a][b][i % 2] = t;
                }
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                System.out.print(dp[i][j][1 - k % 2] + " ");
            }
            System.out.println();
        }
    }
}
