	static int next(long[] arr, long target)  
    {  
        int start = 0, end = arr.length - 1;  

        int ans = -1;  
        while (start <= end) {  
            int mid = (start + end) / 2;  

            // Move to right side if target is  
            // greater.  
            if (arr[mid] < target) {
                start = mid + 1;  
            }  

            // Move left side.  
            else {  
                ans = mid;  
                end = mid - 1;  
            }  
        }  
        return ans;  
    } 

	static int prev(long[] arr, long target)  
    {  
        int start = 0, end = arr.length - 1;  

        int ans = -1;  
        while (start <= end) {  
            int mid = (start + end) / 2;  

            // Move to left side if target is  
            // lesser.  
            if (arr[mid] > target) {
                end = mid - 1;  
            }  

            // Move right side.  
            else {  
                ans = mid;  
                start = mid + 1;  
            }  
        }  
        return ans;  
    } 

	static long power(long x, long y, long p) 
    { 
        long res = 1; 
        x = x % p; 

        while (y > 0) 
        { 
            if (y % 2 == 1) 
                res = (res * x) % p; 
            y = y >> 1;
            x = (x * x) % p; 
        } 
        return  res; 
    } 
