                G[j].clear();
                match[j] = -1;
            }
            for (int j = 0; j < m; j++) {
                if (fr[j] == i || to[j] == i) {
                    cnt++;
                } else {
                    G[fr[j]].add(to[j]);
                }
            }

            int other = m - cnt;

            int max = 0;
            for (int j = 0; j < n; j++) {
                cur++;
                augment(j);
            }
            for (int j = 0; j < n; j++) if (match[j] >= 0) max++;

            ans = Math.min(ans, 2 * (n - 1) + 1 - cnt + other - max + (n - 1) - max);
        }
        out.println(ans);
    }

    boolean augment(int u) {
        if (used[u] == cur) return false;
        used[u] = cur;
        for (int v : G[u]) {
            if (match[v] < 0 || augment(match[v])) {
                match[v] = u;
                return true;
            }
        }
        return false;
    }

