			out.println(timeTravel(l, 0));
		} else {
			double tw = w / a;
			double dw = dist(tw, 0);
			if (dw >= d) {
				out.println(timeTravel(l, 0));
			} else {
				double tSym = timeTravel((d - dw) / 2, w);
				out.println(tw + 2 * tSym + timeTravel(l - d, w));
			}
		}
