    public static boolean isSquareProduct2(int n) {
        if (n % 2 == 1) {
            return false;
        }

        n /= 2;

        int x = 2;

        while (x * x <= n) {
            if (n % (x * x) == 0) {
                n /= (x * x);
                x = 2;

            } else {
                x++;
            }
        }

        return n == 1;
    }

