			cnt[i] = cnt[i / 2] + i % 2;

		int step = 0;
		d[0][0][0] = 0;
		for (int u = 0; u < n; u++) {
			for (int i = 0; i < 1 << m; i++)
				Arrays.fill(d[step ^ 1][i], INF);
