        public void solve(int testNumber, InputReader in, PrintWriter out) {
            int MAX = 6000;
            int MOD = 1000000007;

            int n = in.nextInt();
            int[][] dp = new int[n][MAX];
            dp[0][0] = 1;

            char next;
            int current;
            for (int i = 0; i < n; i++) {
                next = in.next().charAt(0);
                if (i == n - 1) continue;

                current = 0;
                for (int j = MAX - 1; j >= 0; j--) {
                    if (dp[i][j] != 0) {
