                            if (j < MAX - 1) dp[i + 1][j + 1] = (dp[i + 1][j + 1] + dp[i][j]) % MOD;
                        } else {
                            current = (current + dp[i][j]) % MOD;
                        }
                    }

                    if (next == 's') dp[i + 1][j] = current;
                }
            }

            int res = 0;
            for (int i = 0; i < MAX; i++) {
