import java.util.*;
import java.io.*;
import java.math.*;

public class f {

    static int n;
    static long a1, a2, a3, a4, oo = 1000000000000000L;
    static long[][] memo;
    static char[][] arr;

    public static void main(String[] args) throws IOException {
        FastScanner in = new FastScanner(System.in);
        PrintWriter out = new PrintWriter(System.out);

        n = in.nextInt();
        a1 = in.nextLong();
        a2 = in.nextLong();
        a3 = in.nextLong();
        a4 = in.nextLong();

        memo = new long[625][n];
        for (long[] a : memo) Arrays.fill(a, -1);

        arr = new char[4][n];
        for (int i = 0; i < 4; i++) {
            arr[i] = in.next().toCharArray();
        }
        long ans = go(0, 0, 0, 0, 0);

        out.println(ans);


        out.close();
    }

    static long go(int h0, int h1, int h2, int h3, int r) {
        if (r == n) return 0;
        int key = h0 * 125 + h1 * 25 + h2 * 5 + h3;
        if (memo[key][r] != -1) return memo[key][r];
        long min = oo;

        for (int g0 = 0; g0 <= 4; g0++) {
            int nh0 = Math.max(h0, g0);
            long c0 = getCost(g0);
            if (nh0 == 0 && arr[0][r] == '*') continue;
            for (int g1 = 0; g1 <= 3; g1++) {
                int nh1 = Math.max(h1, g1);
                if (g0 > 1)
                    nh1 = Math.max(nh1, g0);
                long c1 = getCost(g1);
                if (nh1 == 0 && arr[1][r] == '*') continue;
                for (int g2 = 0; g2 <= 2; g2++) {
                    int nh2 = Math.max(h2, g2);
                    if (g1 > 1)
                        nh2 = Math.max(nh2, g1);
                    if (g0 > 2)
                        nh2 = Math.max(nh2, g0);
                    long c2 = getCost(g2);
                    if (nh2 == 0 && arr[2][r] == '*') continue;
                    for (int g3 = 0; g3 <= 1; g3++) {
                        int nh3 = Math.max(h3, g3);
                        if (g2 > 1)
                            nh3 = Math.max(nh3, g2);
                        if (g1 > 2)
                            nh3 = Math.max(nh3, g1);
                        if (g0 > 3)
                            nh3 = Math.max(nh3, g0);
                        long c3 = getCost(g3);
                        if (nh3 == 0 && arr[3][r] == '*') continue;

                        long cost = c0 + c1 + c2 + c3;
                        cost += go(Math.max(0, nh0 - 1),
                                   Math.max(0, nh1 - 1),
                                   Math.max(0, nh2 - 1),
                                   Math.max(0, nh3 - 1),
                                   r + 1);
                        min = Math.min(min, cost);
                    }
                }
            }
        }

        return memo[key][r] = min;
    }


    static long getCost(int a) {
        if (a == 0) return 0;
        if (a == 1) return a1;
        if (a == 2) return a2;
        if (a == 3) return a3;
        return a4;
    }

    static Random rand = new Random();
    static void sort(int[] a) {
        int n = a.length;
        for (int i = a.length - 1; i > 0; i--) {
            int j = rand.nextInt(i + 1);
            int tmp = a[i];
            a[i] = a[j];
            a[j] = tmp;
        }
