        return maxClique;
    }

    public void bronKerbosch2(long r, long p, long x) {
        if (Long.bitCount(maxClique) >= Long.bitCount(r | p | x)) return;
        long px = p | x;
        if (px == 0) {
            if (Long.bitCount(maxClique) < Long.bitCount(r)) {
                maxClique = r;
            }
            return;
