		ArrayList<Integer> sel = new ArrayList<Integer>();
		for(int i = 0; i < (1<<n); i++) {
			sel.clear();
			for(int k = 0; k < n; k++) {
				if((i & (1<<k)) != 0)
					sel.add(k);
			}
			if(sel.size() == 1) {
				ans[i][sel.get(0)] = 0;
