	private static boolean isComposite(long a, int s, long d, long n) {
		long x=power(a,d,n);

		if(x==1 || x==n-1) {
			return false;
		}

		for(int i=0;i<s;i++){
			if(x%(n-1)==0) {
				return false;
			}
			x=(x*x)%n;
		}

		return true;
	}

