import java.io.BufferedReader;

import java.io.IOException;

import java.io.InputStreamReader;

import java.io.PrintWriter;

import java.util.Arrays;

import java.util.StringTokenizer;



public class LittleGirlandMaximumXOR {



	static long l, r;

	static long[][] dp;



	static boolean bit(long x, int i) {

		return (x & (1L << (long) i)) != 0;

	}



	static long solve(int i, int a, int b, int c, int d) {

		if (i == -1)

			return 0;

		int mask = (a << 3) | (b << 2) | (c << 1) | d;

		if (dp[i][mask] != -1)

			return dp[i][mask];

		long ans = 0;

		boolean bl = bit(l, i);

		boolean br = bit(r, i);

		// 0 0

		if ((a == 1 || !bl) && (c == 1 || !bl))

			ans = solve(i - 1, a, br ? 1 : b, c, br ? 1 : d);

		// 1 1

		if ((b == 1 || br) && (d == 1 || br))

			ans = Math.max(ans, solve(i - 1, !bl ? 1 : a, b, !bl ? 1 : c, d));

		// 0 1

		if ((a == 1 || !bl) && (d == 1 || br))

			ans = Math.max(

					ans,

					(1L << (long) i)

							+ solve(i - 1, a, br ? 1 : b, !bl ? 1 : c, d));

		// 1 0

		if ((b == 1 || br) && (c == 1 || !bl))

			ans = Math.max(

					ans,

					(1L << (long) i)

							+ solve(i - 1, !bl ? 1 : a, b, c, br ? 1 : d));

		return dp[i][mask] = ans;

	}



