		if(c >= n)
		{
			System.out.println(m);
			return;
		}

		long rem = n-c;
		long h = rem/k;

		long p = power(2, h+1);
		p -= 2;
		p += MOD;
		p %= MOD;
		p *= k;
		p %= MOD;

		long point = p + m - (h*k) % MOD;
		point += MOD;
		point %= MOD;

		System.out.println(point);



	}

	private static long power(int num, long power)
	{
		if(power == 0)
			return 1;
		long res = power(num, power/2);
		res = (res*res)%MOD;
		if(power % 2 != 0)
			res *= num;

		res%=MOD;

		return res;
	}
}

