            while(node.sum==sum){
                node = ts.higher(node);
            }

            Node var = ts.lower(node);
           // System.out.println(sum+" "+var.sum);
            max = 0;
            while(var.sum==sum){

                Node next = ts.higher(new Node(sum,var.r+1,0));

                if(max>1+next.nb){
                    var.nb = max;
                    var.ini = m;
                }
                else if(next.ini==null){

                    var.nb = 1 + next.nb;
                    var.next = next;
                    if(max<var.nb){
                        max = var.nb;
                        m = var;
                    }


                }else{

                    var.nb = 1 + next.nb;
                    var.next = next.ini;
                    if(max<var.nb){
                        max = var.nb;
                        m = var;
                    }

                }


                var = ts.lower(var);

                //System.out.println(sum+" "+var.sum);
            }


        }

        int k = 0;
