		int dMinY = Math.min(Math.min(Math.min(y2[0], y2[1]), y2[2]), y2[3]);
		int dMaxY = Math.max(Math.max(Math.max(y2[0], y2[1]), y2[2]), y2[3]);
		double midX = (dMinX + dMaxX) / 2.0;
		double midY = (dMinY + dMaxY) / 2.0;
