	static int n,t[],g[],MOD=(int)1e9+7;
	static int [][]memo;
	static int dp(int msk,int rem,int lastG) {
		if(rem==0)
			return 1;
		if(memo[lastG][msk]!=-1)
			return memo[lastG][msk];
		int ans=0;
		for(int i=0;i<n;i++) {
			if((msk & (1<<i))==0 && rem>=t[i] && g[i]!=lastG)
				ans+=dp(msk|1<<i,rem-t[i],g[i]);
				if(ans>=MOD)
					ans-=MOD;
		}
		return memo[lastG][msk]=ans;
	}
