            int mod = (int) 1e9 + 7;
            Pair<Long, Long>[] a = new Pair[n + 1];
            a[0] = new Pair<>(0L, 0L);
            for (int i = 1; i <= n; ++i) {
                if (c[i - 1] == '0') {
                    a[i] = new Pair<>(a[i - 1].x, a[i - 1].y + 1);
                } else {
